

select 
orders.created_at::date
,stores.address
,count( distinct case when (orders.created_at::date=first_visit_day and items.item_type = 'drink' and not lower(items.name)='house water') then line_items.order_id else null end) new_user_first_drink_orders
,count(distinct first_drink.user_id) first_drink_orders
,count(distinct orders.id) orders
,count( distinct case when (items.item_type = 'drink' and not lower(items.name)='house water') then line_items.order_id else null end) total_drink_orders

FROM kwwhub_public.orders AS orders
LEFT JOIN kwwhub_public.stores AS stores ON (orders.store_id = stores.id
AND stores.version_id != ''
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) >= (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', stores.effective_date), 'YYYY-MM-DD HH24:MI:SS')) 
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) < (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', stores.expiration_date), 'YYYY-MM-DD HH24:MI:SS'))
)
LEFT JOIN kwwhub_public.line_items AS line_items ON orders.id = line_items.order_id
LEFT JOIN kwwhub_public.items AS items ON line_items.item_id = items.id
AND items.version_id != ''
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) >= (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', items.effective_date), 'YYYY-MM-DD HH24:MI:SS')) 
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) < (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', items.expiration_date), 'YYYY-MM-DD HH24:MI:SS'))
left join


(SELECT 
    min(orders.created_at::date) as first_drink_date,
  orders.user_id
FROM kwwhub_public.orders AS orders
LEFT JOIN kwwhub_public.stores AS stores ON (orders.store_id = stores.id
AND stores.version_id != ''
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) >= (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', stores.effective_date), 'YYYY-MM-DD HH24:MI:SS')) 
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) < (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', stores.expiration_date), 'YYYY-MM-DD HH24:MI:SS'))
)
LEFT JOIN kwwhub_public.line_items AS line_items ON orders.id = line_items.order_id
LEFT JOIN kwwhub_public.items AS items ON line_items.item_id = items.id
AND items.version_id != ''
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) >= (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', items.effective_date), 'YYYY-MM-DD HH24:MI:SS')) 
AND (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', orders.created_at), 'YYYY-MM-DD HH24:MI:SS')) < (TO_CHAR(CONVERT_TIMEZONE('UTC', 'America/Los_Angeles', items.expiration_date), 'YYYY-MM-DD HH24:MI:SS'))
WHERE 
(orders.daypart =1 or orders.daypart is null) and
items.item_type = 'drink' and not lower(items.name)='house water'
